import React,{Component} from 'react';
import {Row,Col,Container,Card,Button} from 'react-bootstrap';

class home extends Component{

    render(){
        return(
            <>
                <Container>
                    <Row >
                        <Col style={{paddingTop:20,paddingBottom:20}}>
                            <Card style={{ width: '18rem' }}>
                            <Card.Img variant="top" src="https://images-na.ssl-images-amazon.com/images/I/514YMVAc6NL._SL1024_.jpg" />
                            <Card.Body>
                                <Card.Title>I phone X</Card.Title>
                                <Card.Text>
                                Rp. 12.000.000
                                </Card.Text>
                                <Button variant="primary"><i className="fa fa-shopping-cart"></i></Button>
                            </Card.Body>
                            </Card>
                        </Col>
                        <Col>2</Col>
                        <Col>3</Col>
                    </Row>
                </Container>
            </>
        );
    }
}

export default home;
